query findManyAnalytics($cursor: AnalyticsWhereUniqueInput, $distinct: [AnalyticsScalarFieldEnum!], $orderBy: [AnalyticsOrderByWithRelationAndSearchRelevanceInput!], $skip: Int, $take: Int, $where: AnalyticsWhereInput){
    findManyAnalytics(cursor: $cursor, distinct: $distinct, orderBy: $orderBy, skip: $skip, take: $take, where: $where){
        category
        client_id
        client_secret
        country
        created_at
        data_collection
        data_retention
        default_view
        id
        name
        property_hit
        property_name
        search_analytics
        share_data
        tracking_code
        tracking_id
        url
        website_name
    }
}